import React from 'react';
import { Carousel, Card } from 'react-bootstrap';

const Landing = () => {
  return (
    <div>
      {/* Header */}
      <header style={{ backgroundColor: '#3498db', padding: '20px', color: '#fff' }}>
        <h1>Hospital Management System</h1>
      </header>

      {/* Carousel */}
      <Carousel>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src="image1.jpg"
            alt="First slide"
          />
        </Carousel.Item>
        {/* Add more Carousel items for each image */}
      </Carousel>

      {/* Services */}
      <section style={{ padding: '20px' }}>
        <h2>Our Services</h2>
        <div className="card-deck">
          {/* Card 1 */}
          <Card>
            <Card.Img variant="top" src="service1.jpg" />
            <Card.Body>
              <Card.Title>Service 1</Card.Title>
              <Card.Text>Service 1 description.</Card.Text>
            </Card.Body>
          </Card>
          {/* Repeat the Card structure for the remaining 6 services */}
        </div>
      </section>

      {/* Location Map */}
      <div style={{ padding: '20px' }}>
        <h2>Location Map</h2>
        {/* Add your map component or iframe here */}
        {/* Example: */}
        <iframe
          title="Hospital Location"
          src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d22403.57364665361!2d-74.00594110269566!3d40.71277665161806!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x0!2zNDDCsDQ1JzM4LjAiTiA3NMKwMjInMDQuNCJX!5e0!3m2!1sen!2sus!4v1584399207509!5m2!1sen!2sus"
          width="600"
          height="450"
          frameBorder="0"
          style={{ border: '0' }}
          allowFullScreen=""
          aria-hidden="false"
          tabIndex="0"
        ></iframe>
      </div>

      {/* Footer */}
      <footer style={{ backgroundColor: '#2c3e50', padding: '20px', color: '#fff' }}>
        <p>Contact us at: example@email.com</p>
      </footer>
    </div>
  );
};

export default Landing;
